import React, {useState} from 'react';
import {StyleSheet, View, Text, ImageBackground, Button, TextInput} from 'react-native';
// import StyledButton from '../StyledButton';
// import styles from './style';

const Login = (props) => {
// const {name,tagline,image} = props;
const [name, setName] = useState('Sahar')
const clickHandler = () => {
    setName('Al Issa')
    console.log("pressed")
}

    return (
        <View >

<Text style = {styles.margin}>Log in</Text>
<View style = {styles.buttonContainer}>
<Text>My name is {name}</Text>
<Text>Enter your Email</Text>
<TextInput 
style={styles.input}
placeholder='example@xxxmail.com'
onChangeText={(val) => setName(val)}/>

<Text>Enter your Password</Text>
<TextInput 
// keyboardType='default'
style={styles.input}
placeholder='e.g .!@#123Aa'
onChangeText={(val) => setName(val)}/>
<Button title = "login" onPress = {clickHandler}/>
     </View>
</View>
    )
}

const styles = StyleSheet.create({
containers: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
buttonContainer: {
    marginTop: 20
},
margin: {
    margin: 30
},
input: {
    borderWidth: 1,
    borderColor: '#777',
    padding: 8,
    margin:10,
    width: 200,
}
})

export default Login;
